import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Button,
  Row,
  Container,
  Col,
  FormGroup,
  Input,
  Form,
  Card,
  CardHeader
} from "reactstrap";
import {
  Typography,
  TextField,
  FormControl,
  Select,
  MenuItem,
  InputLabel
} from "@material-ui/core";
import "../App.css";
import Header from "../header/header";
import Footer from "../footer";
import EventMap from "../mapping/eventhome";

class AddEvent extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Container>
          <br></br>
          <br></br>
          <br></br>
          <br></br>
          <h1
            style={{ textAlign: "left", color: "#FF5555", fontWeight: "700" }}
          >
            Add Event
          </h1>
          <br></br>
          <br></br>
          <div>
            <div style={{ width: "80%" }}>
              <TextField label="Title event" />
              <FormControl>
                <InputLabel id="demo-simple-select-label">Category</InputLabel>
                <Select
                  labelId="demo-simple-select-label"
                  id="demo-simple-select"
                >
                  <MenuItem value={10}>Sport</MenuItem>
                  <MenuItem value={20}>Music</MenuItem>
                  <MenuItem value={30}>Science</MenuItem>
                  <MenuItem value={40}>Programing</MenuItem>
                </Select>
              </FormControl>
            </div>
          </div>
        </Container>
        <Footer />
      </div>
    );
  }
}

export default AddEvent;
